import React, { Component } from "react";
import music from "../../music.json"; 
import { Col, Row, Container } from "./Grid";


class MusicArea extends Component {
  state = {
    music
  };


  render() {
    return (
      <Container fluid>
        <Row>
          <Col size="md-4 sm-12">
            {this.state.music}
          </Col>
        </Row>
      </Container>
    );
  }
}

export default MusicArea;
